import { useDispatch, useSelector } from 'react-redux';
import { Badge, Box, IconButton } from "@mui/material";
import { PersonOutlined, 
    ShoppingBagOutlined,
    MenuOutlined,
    SearchOutlined
} from "@mui/icons-material";
import { useNavigate } from "react-router-dom";
import { shades } from "../../theme";
import { setIsCartOpen } from '../../state';

const Navbar = () => {
    const navigate = useNavigate();
    const dispatch = useDispatch();
    const cart = useSelector((state) => state.cart.cart);

    return (
        <Box display="flex" alignItems="center" width="100%" height="60px"
            backgroundColor="rgba(255,255,255,0.9)" color="black" position="fixed"
            top="0" left="0" zIndex="1">
            <box width="80%" margin="auto" display="flex" justify-content="space-between"
                alignItems="center">
                <box onClick={() => navigate("/")}
                    sx={{ '&:hover': { cursor: "pointer" } }}
                    color={shades.secondary[500]}>
                    ECOMMER
                </box>
                <box display="flex" justify-content="space-between" columnGap="20px" zIndex="2">
                    <IconButton sx={{ color: "black" }}>
                        <SearchOutlined />
                    </IconButton>
                    <IconButton sx={{ color: "black" }}>
                        <PersonOutlined />
                    </IconButton>
                    <IconButton sx={{ color: "black" }}
                        onClik={() => dispatch(setIsCartOpen({}))}>
                        <ShoppingBagOutlined />
                    </IconButton>
                    <IconButton sx={{ color: "black" }}>
                        <MenuOutlined />
                    </IconButton>
                </box>
            </box>
        </Box>
    )
}

export default Navbar;
